import logo from './components/images/skydive.jpg';
import './App.css';

import {
  Box,
  Container,
  Row,
  Column,
  FooterLink,
  Heading,
  Imgaging,
  StartButton,
} from "./AppStyles";


function App()  {
  return (
    <Box>
    <Container>
    <Row>
      <Column>
        <Heading></Heading>
      </Column>
      <Column>
        <Heading>About Us</Heading>
      </Column>
      <Column><StartButton>LET's GET STARTED</StartButton></Column>
    </Row>
  </Container>

</Box>
  );
}

export default App;
